const containerStyle = {
  display: "flex",
  alignItems: "center",
  gap: "16px",
};

const starStyle = {
  display: "flex",
  gap: "4px",
  fontSize: "24px",
};

export default function StarRating() {
  return (
    <div style={containerStyle}>
      <div>
        {Array.from({ length: 10 }, (_, i) => (
          <span key={i}>&#9733;</span>
        ))}
      </div>
      <p>10</p>
    </div>
  );
}
